import React, { Component } from 'react';

class CycleB extends Component {
    render() {
        return (
            <ul>
                <div>70% Working Set 1 3x {Math.round((this.props.weight-this.props.bar)*70/100).toFixed(1)}kg</div>
                <div>80% Working Set 2 3x {Math.round((this.props.weight-this.props.bar)*80/100).toFixed(1)}kg</div>
                <div>90% Working Set 3 3x+ {Math.round((this.props.weight-this.props.bar)*90/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default CycleB;
